bioghist.p:
De taak van de gerechtssecretaris omvat onder meer:  


het dienst doen ter terechtzitting als griffier;


het opmaken van de processen-verbaal van de zitting;


het concipiëren (ontwerpen) van beschikkingen;


het nazien van ingekomen dagvaardingen, requesten;


het fungeren als gesprekspartner van de rechter;


bij vele gerechten is deze belast met de feitelijke leiding van de griffie

De taak parketsecretaris is onder meer belast met:  


het concipiëren (ontwerpen) van dagvaardingen;


het uitvoeren van het sepot en schikkingbeleid in (straf) kantongerechtzaken

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 


U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;


Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;


In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;


Vervolgens bevestigt u uw reservering door deze te versturen.

Van de periode 1979 - 1988 zie inventaris kantongerecht Alphen aan den Rijn 1980 -1989 (nummer toegang 3.03.86) inv. 11;
van de periode 1982 - 1990 zie inventaris kantongerecht Delft 1980 -1989 (nummer toegang 3.03.84) inv.nrs. 23 - 25;
van de periode 1980 - 1989 zie inventaris kantongerecht ‘s- Gravenhage 1980 -1989 (nummer toegang 3.03.90) inv.nrs. 233 - 267;
van de periode 1980 - 1988 zie inventaris kantongerecht Leiden 1980 -1989 (nummer toegang 3.03.88) inv.nrs. 43 - 47.
